    [Benchmark]
    public int ForEachLoop()
    {
        return ForEachLoopInner(Value);
    }

    public static int ForEachLoopInner(string value)
    {
        var sum = 0;
        // ReSharper disable once ForeachCanBeConvertedToQueryUsingAnotherGetEnumerator
        foreach (var character in value)
        {
            sum += CalculateWidth(character);
        }

        return sum;
    }

